import React from 'react';

const Question = ({ question, handleAnswer }) => {
  return (
    <div>
      <h2>{question.question_text}</h2>
      <ul>
        {question.answers.map((answer) => (
          <li key={answer.id} onClick={() => handleAnswer(answer)}>
            {answer.answer_text}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Question;
